import './ColorBox.css'
class ColorBox extends Component {
    render() {
        const {name,background} = this.props
        return (
            <div style={{ background: this.props.background }} className="ColorBox">
                <span>{name}</span>
                <span>More</span>
            </div>
        )
    }
}
export default ColorBox;






